a, b, c, d, e = int(input()), int(input()), int(input()), int(input()), int(input()) # вводим 5 чисел и сохраняем их в переменных
print('Наименьшее число =', min(a, b, c, d, e)) # выводится наименьшее число из 5 введённых с помощью min
print('Наибольшее число =', max(a, b, c, d, e)) # выводится наибольшее число из 5 введённых с помощью max